(1,	0,	'Bree-land Starter Steed',	'Bree-starter Horse',	'Bree-starter Pony',	'Bree-horse',	'Bree-pony',	'',	'Silver',	32,	80,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'While not as fast as a regular, faction or deed steed, the Bree horse is a nice way to get around at a lower level.  A beginner version of the Breetown Liver Chestnut it is a rich reddish Brown with black points, has a standard saddle and dark green cloth blanket.',	NULL,	'Mount Token 2-icon',	0),
(2,	1,	'Bay Steed',	'Bay Horse',	'Bay Pony',	NULL,	NULL,	'',	'Nettles',	62,	100,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Bay horse is a classic dark brown horse with dark brown points and white star.  It comes with a standard leather saddle and no blanket.',	NULL,	'Bay Steed-icon',	0),
(3,	1,	'Bloodbay Steed',	'Bloodbay Horse',	'Bloodbay Pony',	NULL,	NULL,	'',	'Fancy',	62,	100,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Blood Bay horse is a classic reddish brown horse with dark brown points and white star.  It comes with  a standard leather saddle and no blanket.',	NULL,	'Bloodbay Steed-icon',	0),
(4,	1,	'Blonde Sorrel Steed',	'Blonde Sorrel Horse',	'Blonde Sorrel Pony',	NULL,	NULL,	'',	'Coltsfoot',	62,	100,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Blonde Sorrel horse is a classic light tan horse with white star.  It comes with a standard leather saddle and no blanket.',	NULL,	'Mount Token 2-icon',	0),
(5,	1,	'Chestnut Steed',	'Chestnut Horse',	'Chestnut Pony',	NULL,	NULL,	'',	'Barney',	62,	100,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Chestnut is a classic rich brown horse with dark brown points and white star.  It comes with a standard leather saddle and no blanket.',	NULL,	'Chestnut Steed-icon',	0),
(6,	2,	'Prized Mahogany Bay Steed',	'Mahogany Bay Horse',	'Mahogany Bay Pony',	NULL,	'Prized Mahogany Bay Pony',	'Balsam',	'Rusty',	62,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Mahogany Bay, also known as the \'Moors\' horse, is a silky black with white legs.  A standard saddle sits atop a gold and brown blanket.',	NULL,	'Prized Mahogany Bay Steed-icon',	0),
(7,	2,	'The Peoples\' Courser',	'The Free Peoples\' Horse',	'The Free Peoples\' Pony',	'The Free People\'s Horse',	NULL,	'Commander',	'Defender',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'Undoubtedly one of the more difficult steeds to achieve in the game, the rank 12 PvP steed is a rich brown with white points and purple blanket, tack and banner.  A suitable steed for the most dangerous warriors in the Ettenmoors.',	NULL,	'The People\'s Courser-icon',	0),
(8,	3,	'Prized Angmar\'s Free Peoples Steed',	'Prized Angmar\'s Free Peoples Horse',	'Prized Angmar\'s Free Peoples Pony',	NULL,	NULL,	'Unbroken Will',	'Unbroken Spirit',	62,	250,	'Council of the North',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Prized Angmar Free Peoples steed is a grey-colored horse with dark red tack and armor.',	NULL,	'Prized Angmar\'s Free Peoples Steed-icon',	0),
(9,	3,	'Prized Ashen Steed',	'Prized Ashen Horse',	'Prized Ashen Pony',	NULL,	NULL,	'Nutmeg',	'Shortie',	62,	250,	'Council of the North',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Ashen is a sturdy grey and white specked horse with standard saddle and small red and gold blanket specially crafted by the skilled craftsmen of Angmar.',	NULL,	'Mount Token 1-icon',	0),
(10,	3,	'Prized Dark Chestnut Steed',	'Prized Dark Chestnut Horse',	'Prized Dark Chestnut Pony',	NULL,	NULL,	'Peach',	'Tuffy',	62,	250,	'The Wardens of AnnÃºminas',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Dark Chestnut is a sturdy brown and white painted horse with a standard saddle and orange and gold woven blanket handcrafted by skilled craftsmen of Evendim.',	NULL,	'Prized Dark Chestnut Steed-icon',	0),
(11,	3,	'Prized Tundra Steed',	'Prized Tundra-horse',	'Prized Tundra-pony',	'Prized Tundra Horse',	'Prized Tundra Pony',	'Primrose',	'Spark',	62,	250,	'Lossoth of Forochel',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Tundra horse is a very sturdy horse specially suited for cold climates.  It is a classic longhaired rich golden palomino mount with white points, a standard saddle and no blanket.',	NULL,	'Mount Token 2-icon',	0),
(12,	3,	'Prized Rivendell Steed',	'Prized Rivendell Horse',	'Prized Rivendell Pony',	NULL,	NULL,	'Copperleaf',	'Copperhide',	62,	250,	'Elves of Rivendell',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Prized Rivendell steed is a rich brown steed with black points.  Fancy elven gold and grey tack supports a full saddle and saddlebags.',	NULL,	'Prized Rivendell Steed-icon',	0),
(13,	3,	'Prized Galadhrim Steed',	'Prized Galadhrim Horse',	'Prized Galadhrim Pony',	NULL,	NULL,	'Idril',	'AmariÃ«',	62,	250,	'Galadhrim',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The very prized Galadhrim horse is indeed one of the most majestic of all the horses in Middle Earth.  It is a pure white horse with a standard saddle and a blanket handcrafted by the Silvan Elves of the Golden Wood.',	NULL,	'Prized Galadhrim Steed-icon',	0),
(14,	3,	'Prized Eglan-steed',	'Prized Eglan-horse',	'Prized Eglan-pony',	NULL,	NULL,	'Freckles',	'Speckles',	62,	250,	'Eglain',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Prized Eglain steed is a brown and tan Appaloosa styled steed with brown leather tack and full saddle with saddlebags.',	NULL,	'Prized Eglan-steed-icon',	0),
(15,	3,	'Prized Mathom Society Steed',	'Prized Mathom Society Horse',	'Prized Mathom Society Pony',	NULL,	NULL,	'Calamity',	'Mirth',	62,	250,	'The Mathom Society',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Prized Mathom Society Steed is chocolate brown and white painted steed with olive green and gold tack and full saddle and small saddlebags.',	NULL,	'Prized Mathom Society Steed-icon',	0),
(16,	3,	'Prized EsteldÃ­n Steed',	'Prized EsteldÃ­n Horse',	'Prized EsteldÃ­n Pony',	NULL,	NULL,	'Harmony',	'Damsel',	62,	250,	'Rangers of EsteldÃ­n',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Prized Rangers of EsteldÃ­n steed is a pure blonde steed with white points. A full saddle and saddlebags sit atop an olive and gold blanket and brown leather tack.',	NULL,	'Prized EsteldÃ­n Steed-icon',	0),
(17,	3,	'Prized Liver Chestnut Steed',	'Prized Liver Chestnut Horse',	'Prized Liver Chestnut Pony',	'Liver Chestnut Horse',	NULL,	'Poppy',	'Trusty',	62,	250,	'Men of Bree',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The only real faction steed available to early riders, the Liver Chestnut is a rich Reddish-Brown with black points, has a standard saddle and forest green cloth blanket.',	NULL,	'Prized Liver Chestnut Steed-icon',	0),
(18,	3,	'Prized Malledhrim Steed',	'Prized Malledhrim Horse',	'Prized Malledhrim Pony',	NULL,	NULL,	'Riverwind',	'Lovely Lady',	62,	250,	'Malledhrim',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'This is a beautiful steed for those who have earned the respect of the Malledhrim Elves.  Like its name, it is a prized grey steed with black points and ornately carved brown and gold leather tack and saddle.',	NULL,	'Prized Malledhrim Steed-icon',	0),
(19,	3,	'Smokey Black Steed',	'Smokey Black Horse',	'Smokey Black Pony',	NULL,	NULL,	'Valley Whisper',	'Early Dawn',	62,	250,	'Malledhrim',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'This design was the winner in the EU LOTRO horse design contest as is now available as a faction steed. Like its name, it is a smokey black with white star. It comes with a brown leather saddle, saddlebags and leg braces.',	NULL,	'Smokey Black Steed-icon',	0),
(20,	3,	'Prized Grey Company Steed',	'Prized Grey Company Horse',	'Prized Grey Company Pony',	'Grey Company Horse',	NULL,	'Hunter\'s Pride',	'Song Dancer',	62,	250,	'The Grey Company',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Grey Company is a dark grey steed with black mane and tail. It is equipped with solid and sturdy leather tack crafted special for members of the Grey Company.',	NULL,	'Prized Grey Company Steed-icon',	0),
(21,	3,	'Prized Algraig Steed',	'Prized Algraig Horse',	'Prized Algraig Pony',	'AlgraigHorse',	NULL,	'',	'Jade',	62,	250,	'Algraig, Men of Enedwaith',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Algraig steed is a light grey steed with white mane and tail and tribal markings. It is equipped with solid and sturdy leather tack crafted by the skilled craftsmen of the Men of Enedwaith.',	NULL,	'Prized Algraig Steed-icon',	0),
