(27,	3,	'Prized Inn League Steed',	'Prized Inn League Horse',	'Prized Inn League Pony',	NULL,	NULL,	'Guzzler',	'Tipsy',	62,	250,	'The Inn League',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'Sure to make certain that you never run out of ale, the brown and white painted Inn League steed is equipped with 4 mini-kegs and a light blue saddle blanket.',	NULL,	'Prized Inn League Steed-icon',	0),
(28,	3,	'Prized Ale Association Goat',	'Prized Ale Association Goat',	'',	'Ale Association goat',	NULL,	'Sneaky',	'Sneaky',	62,	250,	'The Ale Association',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'Contrary to the Inn League, the Ale Association provides a special Goat for their kindred members.  The goat is equipped with 4 mini-kegs and a red blanket.  Sure to keep you and your fellowship quite merry!',	NULL,	'Prized Ale Association Goat (barter)-icon',	0),
(29,	3,	'Nimble Redhorn-goat',	'Prized Nimble Redhorn-goat',	'',	NULL,	NULL,	'Clover',	'Sage',	62,	250,	'Iron Garrison Miners',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'Equipped with all the tools for the adventurer, the Redhorn Goat is a steed capable of traversing the rigorous Mines of Moria.',	NULL,	'Nimble Redhorn-goat-icon',	0),
