(31,	3,	'Prized Thorin\'s Halls Goat',	'Prized Thorin\'s Halls Goat',	'',	NULL,	NULL,	'',	'Nugget',	62,	250,	'Thorin\'s Hall (Reputation)',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Thorin\'s Hall Goat is dark grey goat with ornate dwarven tack and blue blanket.  Equipped with saddlebags, storage chest and bedroll.  A better way to get around Middle Earth would be hard to find!',	NULL,	'Mount Token 2-icon',	0),
(32,	3,	'Prized Helmingas steed',	'Prized Helmingas Horse',	'Prized Helmingas Pony',	NULL,	NULL,	'Steelmane',	'',	62,	250,	'Helmingas (Reputation)',	0,	'',	'{{Worth|g=|s=|c=}}',	'300 westmnet iron coin',	0,	'',	'The prized Helmingas steed is blonde sorrel horse.  Equipped with full plate armor. A better way to show of your reputation with the guards of Helm\'s Deep would be hard to find!',	NULL,	'Mount Token 2-icon',	0),
(33,	4,	'Anniversary Steed',	'Anniversary Horse',	'Anniversary Pony',	NULL,	NULL,	'Coriander',	'Brook',	62,	100,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'This steed was introduced to celebrate the fourth Anniversary of LOTRO.',	NULL,	'Anniversary Steed-icon',	0),
