(36,	4,	'Steed of the Dusk-watch',	'Steed of the Dusk-watch',	'',	'Steed of the Dusk Watch (Horse)',	'Warden\'s Steed (Pony)',	'Lonesome Glory',	'Thumper',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'This steed was introduced to celebrate the [[Anniversary Celebration 2012|fifth Anniversary of LOTRO]]. Originally intended as a second reputation mount reward for the [[Wardens of AnnÃºminas]], this mount is available from opening [[Item:Envelope|Envelopes]].',	NULL,	'Steed of the Dusk-watch-icon',	0),
(37,	4,	'Fireworks Laden Steed',	'Fireworks Laden Horse',	'Fireworks Laden Pony',	NULL,	NULL,	'Flint',	'Tinder',	62,	200,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'This steed was introduced to celebrate the [[Anniversary Celebration 2012|fifth Anniversary of LOTRO]]. It is outfitted with crates of fireworks on its sides which occasionally shoot off. Features [http://www.youtube.com/watch?v=c8WRJMN-C_k fireworks effect].',	NULL,	'Fireworks Laden Steed-icon',	0),
