(41,	4,	'Springfest Steed',	'Springfest Horse',	'Springfest Pony',	NULL,	NULL,	'Moonshine',	'Brook',	62,	100,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'In celebration of the spring season, the Spring festival horse has a standard saddle and a festive deep green leaf pattern blanket.',	NULL,	'Mount Token 1-icon',	0),
