(84,	9,	'Steed of Minas Ithil',	'Steed of Minas Ithil',	'Steed of Minas Ithil',	'Horse of Minas Ithil',	'Pony of Minas Ithil',	'',	'Charger',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available April 22 - May 6, 2011\'\'\'<br />This silver-grey horse, draped in a flowing bright blue and white covering with matching banner, is meant to display and carry the fearsome Guard of Isildur into battle. The soldiers of Minas Ithil, long since seized by the Enemy and renamed Minas Morgul, would have ridden these steeds. There are some Free Peoples who still remember the Tower of the Moon, and they dress their loyal steeds in the livery of Minas Ithil as a sign to the forces of Mo',	NULL,	'Steed of Minas Ithil (Store)-icon',	0),
(85,	9,	'Steed of Bright Days',	'Steed of Bright Days',	'Steed of Bright Days',	'Horse of Bright Days',	'Pony of Bright Days',	'',	'Powder Puff',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available July 1 - 14, 2011\'\'\'<br />This steed is descended from stock gifted to Cirion, Steward of Gondor, by Eorl the Young following the Battle of the Field of Celebrant and the granting of the lands of Calenardhon to Eorl and his people. The barding represents the flowering fields beneath a blue sky and symbolizes the creation of the sovereign nation of Rohan.',	NULL,	'Steed of Bright Days (Store)-icon',	0),
