(87,	9,	'Fleet-footed Goat',	'Fleet-footed Goat',	NULL,	'Fleet-footed Goat2',	NULL,	'Mapleseed',	'Acorn',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'This is no miner\'s goat. This silky long-haired grey goat is outfitted to swiftly traverse mountain pathways and dark, subterranean tunnels, rather than carry heavy gear and provisions. It is sturdy enough to ride through the Orc-ridden halls of Moria, yet lightly armoured so as not to hinder its ability to move quickly and with great agility, making it highly prized among the messengers of the Iron Garrison.',	NULL,	'Fleet-footed Goat (Store)-icon',	0),
