(94,	9,	'Obsidian Steed',	'Obsidian Steed',	NULL,	NULL,	'Obsidian Steed (Pony)',	'',	'',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available May 1 - 31, 2013\'\'\'<br />This steed has barding made of coloured formed leather in the shape of stylized wings at the shoulders and head, with a cloth caparison.',	NULL,	'Obsidian Halter-icon',	0),
(95,	9,	'Steed of RhÃ»n',	'Steed of RhÃ»n',	NULL,	NULL,	'Steed of RhÃ»n(Pony)',	'',	'',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available June 1 - 30, 2013\'\'\'<br />',	NULL,	'Light Banded Leather Halter-icon',	0),
(96,	9,	'Steed of the Iron Hills',	'Steed of the Iron Hills',	NULL,	NULL,	'Steed of the Iron Hills (Pony)',	'',	'',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available July 1 - 30, 2013\'\'\'<br />',	NULL,	'Iron Hills Halter-icon',	0),
(97,	9,	'Steed of the Hunter',	'Steed of the Hunter',	'',	'Horse of the Hunter',	'Pony of the Hunter',	'Trapper\'s Guide',	'Longshot',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available October 7 - October 20, 2011\'\'\'<br />A Hunter\'s mount must be light and swift to chase down his quarry, yet sturdy enough to bear the weight of the Hunter\'s tools: traps, quivers, and provisions for a long, cold night. Descended from the wild horses of the Rhovanion plains, this steed will bravely bear its master against the forces of darkness.',	NULL,	'Steed of Night (Store)-icon',	0),
(98,	9,	'Steed of the Guardian',	'Steed of the Guardian',	'',	'Horse of the Guardian',	'Pony of the Guardian',	'Shield-bearer',	'Overpowered',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available November 23 - December 8, 2011\'\'\'<br />A Guardian\'s steed must be strong and stout to bear the weight of its master\'s heavy armour and arms. This sturdy mount has an attractive steel gray coat with a black tail and its rugged tack is well designed to carry weapons, shields, and provisions for a long journey to war and danger. This steed has 250 health and allows you to travel 68% faster than running on foot, making it faster and stronger than many other mounts!',	NULL,	'Steed of Night (Store)-icon',	0),
(99,	9,	'Steed of the Rune-keeper',	'Steed of the Rune-keeper',	'',	'Horse of the Rune-keeper',	'Pony of the Rune-keeper',	'Shock',	'Awe',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available January 26 - February 9, 2012\'\'\' <br /> Rune-keepers require a large number of tools and implements to ply their trade â€“ rifflers and chisels, stones and writing tools â€“ and their mounts must be capable of bearing them all. The Rune-keeper\'s steed is well-supplied and ready for a long journey. This liver chestnut steed wears a teal blue saddle pad with silver embroidery and matching neck covering, and its tack is marked with runes of endurance and speed to ensure its rider',	NULL,	'Steed of Night (Store)-icon',	0),
(100,	9,	'Steed of the Champion',	'Steed of the Champion',	NULL,	NULL,	'Steed of the Champion (Pony)',	'Fervour Builder',	'Glorious Ardour',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available April 20 - May 3, 2012\'\'\' <br /> Champions are the masters of many weapons, which means their mounts must be able to bear the weight of their arms. This sturdy grey steed is equipped and especially trained for battle, strong enough to bear both arms and armourâ€”both his rider\'s and his own. Bedecked with leather and bronze plates with belts of gold, the Champion\'s Steed exemplifies the mount of a warrior. This steed has 250 health and allows you to travel 68% faster than runn',	NULL,	'Steed of the Champion (Store)-icon',	0),
(101,	9,	'Steed of the Burglar',	'Steed of the Burglar',	NULL,	NULL,	'Steed of the Burglar (Pony)',	'Shadow\'s Step',	'Mischief Maker',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available June 21 - July 5, 2012\'\'\' <br /> Burglars are at their strongest when moving silently through the shadows and need a mount that can do the same. The Steed of the Burglar is of a dusky colour and wears leather armour of dulled grey, green, and brown, specifically chosen to blend into the varying environments its rider may move through. The Burglar\'s Steed has plenty of bag space to carry the implements of its master: picks, marbles, stun dust, and what not. This steed has 250 h',	NULL,	'Steed of the Burglar (Item)-icon',	0),
(102,	9,	'Steed of the Lore-master',	'Steed of the Lore-master',	NULL,	NULL,	'Steed of the Lore-master (Pony)',	'Book-bearer',	'Wisdom\'s Charger',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available August 3 - August 16, 2012\'\'\' <br /> Lore-masters are seekers and practitioners of ancient lore and knowledge. Their steeds must be arrayed such that they can bear numerous scrolls, parchments, and writing implements. This mount is blanketed in a deep blue embroidered with silver stars to reflect the night sky, the realm of Elbereth Gilthoniel, revered of the Elves who are the greatest of lore-masters.',	NULL,	'Steed of the Lore-master (Store)-icon',	0),
(103,	9,	'Steed of the Minstrel',	'Steed of the Minstrel',	NULL,	NULL,	'Steed of the Minstrel (Pony)',	'Melody',	'Harmoniser',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available October 4-18, 2012\'\'\' <br /> Minstrels bear the burden of carrying Middle-earth\'s history through song and tale. Their gifts bring merriment through a Tavern sing-along as well as boost the strength and morale of hardened warriors in the thick of battle. This Blonde Sorrel steed is delightfully decorated with ribbon, caparison, and instruments are tied to the croup. It\'s a cheerful and welcoming sight for both town-folk and the front line.',	NULL,	'Steed of the Minstrel (Store)-icon',	0),
(104,	9,	'Steed of the Captain',	'Steed of the Captain',	NULL,	NULL,	'Steed of the Captain (Pony)',	'Halberd\'s Holder',	'Leader\'s Mount',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available November 15 - 29, 2012\'\'\' <br /> Long have the Free Peoples of Middle-earth stood tall against forces of darkness. Among them are Captains who muster strength and perseverance while smiting the threats that bear down on them. This Captains\' steed is lightly armoured with steel plating on the head, neck, and hindquarters. Bright coloured details on the caparison allow for easy recognition in the fields of battle.',	NULL,	'Steed of Night (Store)-icon',	0),
(105,	9,	'Steed of the Warden',	'Steed of the Warden',	NULL,	NULL,	'Steed of the Warden (Pony)',	'Spear',	'Javelin',	68,	250,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	1995,	'',	'\'\'\'First available December 20-31, 2012\'\'\' <br />Far along the borders of the Wild, protecting civilized lands from harm are the prepared Warden. For generations they have been held with high admiration for their swift call to action and their steadfast resolve in protecting the inhabitance of Middle-earth. The Steed of the Warden is outfitted with the bare needs of a patroller. Itâ€™s lightly armored in key areas, with enough space for javelins, shields, and provisions.',	NULL,	'Steed of Night (Store)-icon',	0),
(106,	10,	'Cremello Steed',	'Cremello Horse',	'Cremello Pony',	NULL,	NULL,	'Sandy',	'Silt',	62,	200,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'Those that attended the PAX East 2011 received a code which may be redeemed for this promotional mount bearing the winning design of the [http://www.lotro.com/news/965-lotro-design-a-horse-contest-pax-east-edition \"Design a Horse Contest: PAX East Edition\"] contest. Those that could not attend the convention, received the chance to win this mount with one of the LOTRO Lotteries.',	NULL,	'Cremello Steed (Store)-icon',	0),
(107,	10,	'Perlino Steed',	'Perlino Horse',	'Perlino Pony',	NULL,	NULL,	'Beauty',	'Sunshine',	62,	200,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'Promotional codes for this mount were handed out at PAX East 2012 with giveaways also happening through the LOTRO Twitter and in [[lottery|lotteries]].',	NULL,	'Perlino Steed-icon',	0),
(108,	10,	'Dusky Nimblefoot Goat',	'Dusky Nimblefoot Goat',	'',	NULL,	NULL,	'Clover',	'Sage',	62,	60,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'\'\'\'Given with pre-purchase of Adventurer\'s Pack\'\'\'<br />',	NULL,	'Dusky Nimblefoot Goat (2)-icon',	0),
(109,	10,	'Green-clad Steed of the Gap',	'Green-clad Horse of the Gap',	'Green-clad Pony of the Gap',	NULL,	NULL,	'Jewel',	'Emerald',	62,	200,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Rohirrim steeds are fantastic blonde sorrel mounts with Rohirrim drapery with individual symbols. Equipped with ornate sturdy saddle and tack as well as facial and neck armor! Players received a choice of one of the three steeds with the Heroic Edition of [[Rise of Isengard]] and received all three steeds after pre-ordering the Legendary Edition.',	NULL,	'Green-clad Steed of the Gap (Store)-icon',	0),
(110,	10,	'Red-clad Steed of the Gap',	'Red-clad Horse of the Gap',	'Red-clad Pony of the Gap',	NULL,	NULL,	'Ruby',	'Fire Topaz',	62,	200,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Rohirrim steeds are fantastic blonde sorrel mounts with Rohirrim drapery with individual symbols. Equipped with ornate sturdy saddle and tack as well as facial and neck armor! Players received a choice of one of the three steeds with the Heroic Edition of [[Rise of Isengard]] and received all three steeds after pre-ordering the Legendary Edition.',	NULL,	'Red-clad Steed of the Gap-icon',	0),
(111,	10,	'White-clad Steed of the Gap',	'White-clad Horse of the Gap',	'White-clad Pony of the Gap',	NULL,	NULL,	'Opal',	'Diamond',	62,	200,	'',	0,	'',	'{{Worth|g=|s=|c=}}',	'',	0,	'',	'The Rohirrim steeds are fantastic blonde sorrel mounts with Rohirrim drapery with individual symbols. Equipped with ornate sturdy saddle and tack as well as facial and neck armor! Players received a choice of one of the three steeds with the Heroic Edition of [[Rise of Isengard]] and received all three steeds after pre-ordering the Legendary Edition.',	NULL,	'White-clad Steed of the Gap (Store)-icon',	0),
